import React from "react"
import "./CoffeeBanner.css"

function CoffeeBanner () {
    return(
        <>
          <img src="/imgs/coffee_white.jpg" className="coffeeJumbotron" alt="coffee background" />

        </>
    )
}

export default CoffeeBanner;
